import { FaShoppingCart } from "react-icons/fa";
import {NavLink} from "react-router-dom";
const Navbar = () => {
  return (<div>
    <div className="flex flex-row justify-between">
      <NavLink to="/"><img src="https://assets.designhill.com/resize_img.php?atyp=logo_maker&w=940&h=640&flp=1700126632-19338207086555dfa8311da1-19692107.jpg" /></NavLink>
      <div>
        <p>Home</p>
        <FaShoppingCart />
      </div>
    </div>
  </div>);
};

export default Navbar;
